import React from 'react'

class Unexpanded extends React.Component{
    constructor(props){
        super(props)
        this.state = {numberOfKills: ''}
        }
        render(){
            return (
                <div>
                    <p className = 'noPad'>{this.props.name}</p>
                    <p>{this.state.numberOfKills}</p>
                </div>
            )
        }
        componentDidMount = () => {
            axios.get('/getWeatherInLondon').then(response => {
                this.setState({weather: response.data.temp})
            })
        };
};

export default Unexpanded;
